 banking opportunities. A portion of the funding will also be used to purchase a vehicle for mobile outreach efforts.","New construction of homes for income-eligible, first-time homeowners on vacant lots in Rochester's fomer 'redlined' neighborhoods.","Repair, restoration and reconstruction of exterior parapets, limestone and brick masonry, historic windows, and structural framing systems for the east, south and north facades, and repairs to the adjacent east terrace.","Replacement of lost government revenues due to the pandemic. Funds will be utilized to support continuation of government services.","Expansion of the City's high demand roofing assistance program. Funds may cover replacement of roofs, skylights, roof drains, gutters and roofign masonry structure/decking, and parapet reconstruction for income eligible homeowners.","Wraparound services  and neighborhood outreach via collaboration between well-known community organizations in the crescent.","This ROC the Riverway project encompassing a building addition and modernazation to the southwest face of the RRCC to create a new and revitalized event space that directly engages with the downtown riverfront. The expanded space will enable patrons to participate in Convention Center events and enjoy the spectacular views of the majestic Genesee River simultaneously. The project will also include, but is not limited to, building facade repairs and strategic river wall repairs.","The funds provided will assist residentail property owners in replacing lead service lines in an effort to reduce the amount of lead in drinking water.","A collaborative 'Hive' program geared toward BIPOC youth that offers year-round workforce programming, wraparound services and career placement pathways.","Provision of rehab grants to income-eligible, owner-occupants. Funds will be allocated to support areas where housing development projects are located, areas where the most gain can be achieved as per the Housing Market Study, and to mitigate blight and hazards city-wide.","Replacement of lost government revenues due to the pandemic. Funds will be utilized to support continuation of government services.","The Nature Center will serve as Rochester's hub for specialized environmental education and expeditionary experiences along the Genesee River including interactive exhibits, demonstration gardens, wildlife, outdoor adventures, summer camps and a nature pre-K. This project is supported by the ROC the Riverway initiative.","Expand and strengthen the LPN, CNAT&amp;D, HHA, and the Clinical Bridge programs to promote a smoother transition for working LPNs to succeed in MCC’s RN program.","A workforce development program that would pay SNFs and HHCAs for the successful recruitment and training of certified nursing assistants (CNAs), home health aides (HHAs), licensed practical nurses (LPNs), and registered nurses (RNs), which will expand service capacity within the SNFs and HHCAs.  Monroe County (MC) SNFs and HHCAs would receive $11,500 per CNA/HHA employed and trained.","Continued provision of free, healthy meals to senior citizens while supporting small business restaurants disproportionately impacted by the pandemic.","A one-stop-shop for previously incarcerated residents.","Establish and administer a revolving loan fund, primarily microloans up to $50,000*, to provide access to capital and technical assistance not otherwise available to small and start-up businesses","Funding will be used to invest in city-based businesses to expand healthy food access, attract new  healthy food retail businesses to target areas, and implement innovative, alternative food retail models.","The Rochester Peace Collective will provide funding to community-based organizations to work collaboratively and in close alignment with the City to prevent violence.","Wraparound health services for underrepresented and minority communities (LGBTQ+, BIPOC, homeless) including a Mobile Access Clinic, Syringe Exchange Program and a Food Cupboard.","Approaches violence with the understanding that violence is an epidemic process that can be stopped using the same evidence-based, public health strategies employed to fight epidemics such as COVID-19, AIDS and Tuberculosis","Use software developer to create a one stop location for job seekers to identify their aptitude, locate available jobs that fit, and available training to obtain jobs.","Creation of one stop location for healthy birthing services supporting underserved communities.","Renovation of facilities at Baden Street to add a Mental Health clinic specializing in BIPOC communities.","Firehouses are on average 70 years old. Funds will be utilized to make capital imporvements to accommodate the response model and workforce diversity that has changed significantly in the many years since many of these facilities were designed and constructed. Renovations will include, but are not limited to, addition of gender neutral facilities, building system repairs and replacements, and code compliance and site upgrades at critical, high priority facilities.","Firehouses are on average 70 years old. Funds will be utilized to make capital imporvements to accommodate the response model and workforce diversity that has changed significantly in the many years since many of these facilities were designed and constructed. Renovations will include, but are not limited to, addition of gender neutral facilities, building system repairs and replacements, and code compliance and site upgrades at critical, high priority facilities.","Services for youth (aged 10-20) at risk of gun violence including housing, transition advocacy services and a Justice Peer Program with adult mentors who have experience in the juvenile legal system.","Grant assistance program for small existing and start-up commercial and manufacturing businesses with expansion and/or business retention projects.","Health &amp; Wellness Program creates a long-term framework that supports and recognizes the critical linkages between community wellness, mental health, and public safety.","A wraparound program supporting underrepresented communities in distressed zip codes focused on training for skilled trades workers including Mold Abatement Workers, Asbestos Handlers, and Lead Abatement Workers.  Also offers certifications in OSHA 10.","Replacement of outdated network infrastructure and technology that support core City functions.","The Blue Cross Arena at the War Memorial was constructed in the 1950's and is the home to the Rochester Americans AHL hockey team and hosts many other sports and public events throughout the year. This project includes design and intallation of a modern replacement ice chiller plant, which creates and maintains the ice sheet, utilizing an allowable refrigerant type.","Eliminating barriers to healthcare for underrepresented communities:  infrastructure improvements and comprehensive training for health care professionals. Proposal includes a new van to provide access and services directly to residents in neighborhoods with the most need.","The Peacemaker Fellowship is a transformative mentoring program that enrolls the highest risk individuals in a personalized and structured cohort for an 18-month period. The model has been effective in bridging the gap between anti-violence programming such as outreach and breaking the cycle for the hard to reach populations at the center of violence in urban areas.","Expansion of the RPD Office of Business Intelligence staffing to develop necessary business processes, manage data workflow, create analytical products and upgrade the existing Open Data Portal.","Rochester Land Bank initiatve focused on the creation home-ownership for low-moderate income residents. The program focuses on medium to large scale development parnters acquiring and rehabbing homes in challenged neighborhoods and/or targeted neighborhoods where other development is taking place.","Doula program to prevent black maternal and infant mortality as well as a 15-week mentoring and educational course for fathers (with a focus on previously incarcerated individuals).","A pilot Guaranteed Basic Income program in the form of a monthly stipend for 175 income-eligible residents per year over the course of two years.","Wraparound services for individuals and families fleeing domestic violence or human trafficking who may be  deaf or hard of hearing.","The Targeted Mixed-Use Rehabilitation Grant Program will provide financial assistance to eligible property owners who own a mixed-use property in identified targeted areas. Eligible uses for the program will included renovations to the residential units to address lead-based paint hazards, health and safety hazards, plumbing and electrical repairs, code violations and other improvements to meet certificate of occupancy standards.","The creation of Neighborhood Centers at Lewis Street, Thurston Road, and inside the Maplewood Family Branch.","A wraparound service and workforce development program to help individuals with disabilities.","This funding will be used to address utility relocations and other critical foundational activities to advance the full vision of creating riverfront connectivity on the downtown waterfront by establishing an iconic public space and extending the Genesse Riverway Trail through downtown Rochester.","Pavement reconstruction and water infrastructure improvements that will enhance traffic safety and efficiency and improve the riding quality of the roadway, accessibility, and streetscape.","Repairs and supplemental structural support within the South Avenue and Stone Street Wings of the South Avenue Garage.","Youth and families within the city of Rochester have been struggling with how to navigate the many thoughts and feelings that accompany the trauma associated with the COVID pandemic, from the increase in violence, to the isolation experienced during key developmental years. The City will utilize ARPA funding to partner with one or multiple agencies to provide professional social-emotional, health and wellness supports and programming to the youth and families that attend R-Centers.","Deaf Refugee Advocacy Community Connections will provide ASL and English workshops, soft skills education, financial literacy courses, independent living skills programs, technical competencies coaching and workforce development training.","Renovation of transitional housing complex for homeless and low-income male veterans.","ARPA funding will be used to procure and implement an enterprise Accounts Receivable and Utility Billing software solution. The new solution will include enhanced workflow and processing capabilities to improve the efficiency of operations, as well as offering enhanced online billing and payment functionality for customers to access invoices, make on-line payments, view payment history, and submit service requests.","Enhance Durand Eastman Park through the addition of acessible public pathways and numerous site improvements including lighting, a bus shelter for public access, signage, emergency vehicle access, bicycle parking, plantings, lighting and landscaping.","Provide daycare services, increase the number of households who have access to daycare, allowing them to accept jobs.  Create new child care businesses in the county and reopen a facility.","Creation of a Multi-Disciplinary Justice Center and enhancement of wraparound services for domestic violence survivors.  The need for these kinds of services has increased due to the COVID-19 pandemic.","Redesign and reconstruction of this scenic park located in downtown Rochester spanning the Genesee River just south of High Falls, close to Main Street. This is a project supported by the ROC the Riverway initiative.","Using their delivery truck model and relationships with organizations who work with low-income families, Foodlink will enhance their operations and address existing gaps in traditional Federal Nutrition Programs (FNPs) to serve more quality, nutritious meals to multi-generational families throughout Monroe County.","Program that will provide no cost loans or grants to those at or below 200% of the Federal poverty line no cost loans or grants who need transportation to start or keep employment. Support services such as employment coach/mentor and financial literacy.","A mobile welding lab that offers training programs to at-risk youth (18-24), inmates and offenders on probation that have significant barriers to employment.","A hydroponic farm that will provide healthy food to vulnerable communities (homeless, veterans, children etc.) as well as job training and educational opportunities for Monroe County residents.","A program that focuses on giving underrepresented communities the tools, training and support they need to succeed in the skilled trades.","Park renovations to provide sightlines and access to the waterfront and trail system, enhance public recreational use of the parkland, and provide direct public recreational use of the Genesee River for non-motorized hand carried watercraft. This is a project supported by the ROC the Riverway initiative.","Upgrade access to language services: the department will work with local educational institutions like RIT and MCC to get over 200 people (community members and employees) certified, trained and developed to deliver language access services in their respective departments or community organizations. This program also proposes to purchase equipment and tools for interpretation services that can be borrowed by MC Departments and approved community organizations; Increase opportunity for MWBEs to kick start their growth while increasing the strength of entrepreneurship in Monroe County for women and people of color.  The program will fund justified equipment, material, or personnel costs to help MWBEs start-up or expand their business over a 12-month period. The program proposes to fund 40-60 (10-15 per year) businesses over 4 years.","Provision of financial assistance to income-eligible, owner-occupant seniors. Funds will be allocated to support areas where housing development projects are located, areas where the most gain can be achieved as per the Housing Market Study, and to mitigate blight and hazards city-wide.","Partnership with The City of Rochester to expand the City’s existing land bank to incorporate the twenty nine suburban towns and villages within Monroe County. creation/ enhancement of a website, legal expenses, planning studies and acquisition and/or demolition of property.","Collaborative project with RCSD that would create 8 school-based mental health clinics and establish telehealth infrastructure.","Grants for low-income homeowners to receive energy-efficient home improvement.","Wraparound services and support for seniors to enhance access to healthcare: LPNs will coordinate transportation and attend medical appointments with older adults, facilitate telehealth, arrange pharmacy delivery and schedule preventative health care screens and vaccinations.","Funds will be used to support predevelopment activities related to the ongoing Bull's Head revitalization project, located on the western part of the city surrounding the intersection of West Main Street, West Avenue, Brown and Genesee Streets.","Procure a subject matter expert (SME) on recruitment and retainment of a diverse workforce within the Department of Public Safety","Creation of a Mentoring Center and enhancement of BBBS program to serve more youth with wraparound services.","The existing spray park, installed in 2001, was the City's first spray park. The spray park is reaching the end of its service life and this project will update the mechanical, electrical, plumbing, control, and surfacing systems.","A mobile boutique and career center that would offer workforce training and career attire for underserved women.","Located in Baden Park, this impactful community project will creat an outdoor learning environment that will present historical narratives of Rochester's Black Feedom Struggle, emphasizing the rich history of civil rights and civic engagement.","Provision of career exploration, employment skills training, and support services for entry-level healthcare workers.","Bring together neighborhood teens with beat officers who patrol their streets.  Over the course of 7 sessions-- including a graduation ceremony and one follow-up on line reunion—youth participants and local police officers engage in discussions, games, and role plays to build their public speaking and facilitation skills, get to know each other on a personal level, and learn from each other.","Helps vulnerable Monroe County residents with financial counseling to secure affordable auto loans and find reliable transportation with local lending partners.","Security measures to fortify the church (lighting, security film for windows, safe rooms etc.) as well as active shooter training.","Firehouses are on average 70 years old. Funds will be used for repairs at various firehouses including but not limited to, site paving at multiple firehouses to maintain and improve truck access to the apparatus bays.","Firehouses are on average 70 years old. Funds will be utilized to make capital imporvements to accommodate the response model and workforce diversity that has changed significantly in the many years since many of these facilities were designed and constructed. Renovations will include, but are not limited to, addition of gender neutral facilities, building system repairs and replacements, and code compliance and site upgrades at critical, high priority facilities.","Family Reunification Centers provide a venue for authorities to provide information to victims, coordinate access to support services, and facilitate the collection of information from families about the victims that can be used for victim identification. A Crisis Assistance Center provides a central location which is designed to ensure effective communication between agencies responsible for the provision of family assistance services; ensure efficient delivery of family assistance services by assessing needs, identifying gaps, avoiding duplication of services; and coordinating/managing requests for services","Incentivize COVID vaccination and booster shots for the City's workforce to protect the health of employees' families, friends, and neighbors as well as city residents who visit City Hall and other City workplaces.","The Rochester firehouses are on average 70 years old, with the majority built between 1950 and 1965. Funds will be used to make capital improvements to accomodat the RFD response model and workforce diversity that has changed significantly in the years since many of these facilities were designed and constructed.","Expansion of the capacity of this existing, successful program. Additional participants will gain manufacturing skills and complete required occupational health and safety trainings while networking with local employers to begin a successful career in the trades.","Firehouses are on average 70 years old. Funds will be used to make capital improvements to accommodate the response model an dworkforce diversity that has changed significantly in the years since many of these facilities were designed and constructed.","Administration of the City's Kiva program to increase the volume of low-interest loans to Rochester entrpreneurs.","External consulting expertise and administrative support for ARPA compliance, reporting and project management.","The Broad and Allen Firehouse Renovation Project will renovate the existing kitchen and exhaust hood with a code compliant exhaust hood and fire suppression system.","Establishment of a new downtown tour boat, docked at Corn Hill Landing, is an important ROC the Riverway initiative and is anticipated to be a major tourist attraction for our community. In addition, CHN will establish its new ticket and office operation at Corn Hill Landing.","Provision of employment skills training and stipends for youth.","The funds will be used to implement new network security hardware and licenses, enhance the City's cybersecurity operations center, procure outside assessment of the cybersecurity program and practices, increase security training, and expand and improve external vulnerability scanning.","Expansion of vending and multi-use event spaces and provide new business development support services.","Several ARPA-funded projects included funding for staffing necessary to implement the program or service. These expenses are included within a project's \"total appropriation,\" however it is the City's practice to account for the employee wages within the implementing department and the employee fringe benefit expenses within the Department of Undistributed Expenses."],"html":true,"width":500,"align":"left","headerStyle":{"font-weight":"normal"}},{"id":"current_as_of","name":"Current as of","type":"Date","style":"function(rowInfo, colInfo) {\nconst rowIndex = rowInfo.index + 1\nif (colInfo.id === 'program' & rowIndex === 1) {\n  return { fontSize: '80%', fontStretch: 'ultraCondensed', whiteSpace: 'preLine' }\n}\n\nif (colInfo.id === 'program' & rowIndex === 2) {\n  return { fontSize: '80%', fontStretch: 'ultraCondensed', whiteSpace: 'preLine' }\n}\n\nif (colInfo.id === 'program' & rowIndex === 3) {\n  return { fontSize: '80%', fontStretch: 'ultraCondensed', whiteSpace: 'preLine' }\n}\n\nif (colInfo.id === 'program' & rowIndex === 4) {\n  return { fontSize: '80%', fontStretch: 'ultraCondensed', whiteSpace: 'preLine' }\n}\n\nif (colInfo.id === 'program' & rowIndex === 5) {\n  return { fontSize: '80%', fontStretch: 'ultraCondensed', whiteSpace: 'preLine' }\n}\n\nif (colInfo.id === 'program' & rowIndex === 6) {\n  return { fontSize: '80%', fontStretch: 'ultraCondensed', whiteSpace: 'preLine' }\n}\n\nif (colInfo.id === 'program' & rowIndex === 7) {\n  return { fontSize: '80%', fontStretch: 'ultraCondensed', whiteS